import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';

class Main extends Component {
  render() {
    return (
      <div className="Main">
        <div className="Header">Header</div>
        <div className="NavBar">
          <MenuItem/>
          <MenuItem/>
          <MenuItem/>
          <MenuItem/>
          <MenuItem/>
          <MenuItem/>
          <MenuItem/>
          <MenuItem/>

        </div>
        <div className="LitleMain">
          <div className="Logo">Logo</div>  
          <div className="SignPanel">
            <SignItem/>
            <SignItem/>
          </div>
        </div>
      </div>
    );
  }
}

class MenuItem extends Component{
    render(){
      return(
        <div className="MenuItem">
          <h1>Oferta</h1>
        </div>
      );
    }
}
class SignItem extends Component{
  render(){
    return(
      <div className="SignItem">
        <h1>Zaloguj się</h1>
      </div>  
    )
  }
}

class LastMinute extends Component {
  render(){
    return(
      <div className="LastMinute">
        <h1>{this.props.name}</h1>
        <div className="LastTrips">
          <Trip/>
          <Trip/>
          <Trip/>
          <Trip/>
        </div>
      </div>


    );
  }
}
class Trip extends Component{
  render(){
    return(
      <div className="Trip">
        <div className="Info">
          <ul>
            <li>01.07 - 20.07.2019</li>
            <li>6789 PLN</li>
          </ul>
          <div className="Level">B</div>
        </div>
        <div className="Desc">
          <div className="TripName">Syberia</div>
          <div className="Type">Trek</div>
          <p>Tu będzie opis trasy</p>
          <div className="SeeMore">Więcej</div>

        </div>
      </div>
    );
  }
}

class AboutUs extends Component{
  render(){
    return(
      <div className="AboutUs">
        <h1>O nas</h1>
        <p>At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat</p>
        <div className="UnFold">
          <i class="fas fa-ellipsis-h"></i>
        </div>
      </div>
    );
  }
}



class App extends Component{
  render(){
    return (
      <div className="App">
        <Main/>
        <LastMinute name="LastMinute" />
        <AboutUs/>
      </div>
    );
  }
}


export default App;
